import React from 'react';
import './App.css';
import Routerlinkk from './RouterLink/index';
import Header from '../src/components/Client/Header/index';
import Footer from '../src/components/Client/Footer/index';
import DashboardResults from '../src/components/Client/DashboardResults/index';

import { Row, Col } from "antd";

const resultArray = [
  { id: '1' },
  { id: '2' },
  { id: '3' },
  { id: '4' },
  { id: '5' }
]

const results = resultArray.map(x =>
  <div className="mini-table">
    <DashboardResults />
  </div>
)

function App() {
  return (
    (
      <div>
        {/* header giữ nguyên */}
        <Header />
        <div className="dashboard">
          {/* screen to */}
          <div className="main-dashboard">
            {/* màn hình sẽ thay đổi ở đây */}
            <Row>
              <Col span={16}>
                <div>
                  <Routerlinkk />
                </div>
              </Col>
              <Col span={8}>
                <div>
                  {this.results}
                </div>
              </Col>
            </Row>
          </div>
          {/* end screen to */}

          {/* screen nho */}
          <div className="main-dashboard-small-screen">
            {/* màn hình sẽ thay đổi ở đây */}
            <Row>
              <Routerlinkk />
            </Row>
          </div>
          {/* end screen nho */}

        </div>
        {/* footer giữ nguyên */}
        <Footer />
      </div>
    )
  );
}

export default App;
